INSERT INTO cms_article_data (id,content,copyfrom,relation,allow_comment) VALUES ('1','<p>&nbsp; &nbsp; &nbsp; &nbsp; 现在，他前生所做的这个梦，向他缓缓走过来了，裹着银白的纱，云里雾里，向他走过来了。走过玫瑰色的窗子，她变了玫瑰色；走过蓝色的窗子，她变了蓝色；走过金黄色的窗子，她和她的头发燃烧起来了。</p><p><br></p><p><img src="/uploads/editor/userid_1/images/2017-09-21/bc4e61ceb784415e8797315cfb9adef8.jpg" alt="57004560_p0" style="max-width:100%;"><br></p><p><br></p>','网络','1,2,3','1') ;
INSERT INTO cms_article_data (id,content,copyfrom,relation,allow_comment) VALUES ('10','<p>有一年圣诞节，室友和女朋友约会去了。我一个人在房间里。我把浴室的灯灯开，把热水灯开，浴室里就雾气腾腾透出光亮，像一个神迹显现。我在隔着一个客厅的房间里上网，写日志，发微博，假装自己正在等一个女人洗完澡，出来陪我做爱，但其实水是我开的，浴室里没人。
INSERT INTO cms_article_data (id,content,copyfrom,relation,allow_comment) VALUES ('11','<p>我的日子会怎么过？</p><p>我会一样的洗衣服，擦地，管我的盆景，铺我的床。偶尔，我会去小镇上，在买东西的时候，跟人说说话，去邮局信箱里，盼一封你的来信。</p><p>    也可能，在天气晴朗，而又心境安稳的时候，我会坐飞机，去那个最后之岛，买一把鲜花，在荷西长眠的地方坐一个静静的黄昏。</p><p>    再也没有鬼哭神号的事情了，最坏的已经来过了，再也没有什么。我只是有时会胃痛，会在一个人吃饭的时候，有些食不下咽。</p><p>    也曾对你说过，暮色来时，我会仔细的锁好门窗，也不再在白日将自己打扮得花枝招展，因为我很明白，昨日的风情，只会增加自己今日的不安全，那么，我的长裙，便留在箱子里吧。</p><p>    又说过，要养一只大狼狗，买一把猎枪，要是有谁，不得我的允许敢跨入我的花园一步，那么我要他死在我的枪下。说出这句话来，你震惊了，你心疼了，你方才知道，Ｅｃｈｏ的明日不是好玩的...</p><p><br></p><p><img src="/uploads/editor/userid_1/images/2017-09-21/88aeab76d9c9482fab3018224d6d3857.jpg" alt="aab5119f05a7a9f9fdfe0840a940c66b_r" style="max-width:100%;"><br></p><p><br></p>','来源','1,2,3','1') ;
INSERT INTO cms_article_data (id,content,copyfrom,relation,allow_comment) VALUES ('12','<p>&nbsp;“怎么晒这么黑？” </p><p><br></p><p>“我徒步旅行了两个礼拜！到处走，只带了背包和睡袋。所以才晒黑的。” </p><p><br></p><p>“走到哪儿去了？” </p><p><br></p><p>“从金泽开始，绕了能登半岛一周，然后走到新宿。”</p><p><br></p><p> “一个人？” </p><p><br></p><p>“是呀！”我说。“到处都会碰上旅伴嘛！” </p><p><br></p><p>“有没有什么罗曼史呀？在旅途上和女孩邂逅什么的。”</p><p><br></p><p> “罗曼史？”我惊道。“喂！你果然是误解了。带着睡袋、满脸胡须、随处乱逛的人要到哪儿去搞什么罗曼史呀？” </p><p><br></p><p>“你总是像这样一个人旅行吗？”</p><p><br></p><p> “是啊！”
INSERT INTO cms_article_data (id,content,copyfrom,relation,allow_comment) VALUES ('13','<p>&nbsp; &nbsp; &nbsp; &nbsp; 我们都会遇到那个人吧，陪你走过一段路，影影绰绰似乎开始了模糊的恋情，事后想来却仿佛停止于尚未开始的爱。 或许是多年再见，各自安静生活数年。在某个人潮拥挤的街头，透过公车的玻璃窗突然看见你，想叫让司机马上停车，想用力拍打窗户来引起你的注意，想从车上跳下来，想奔跑，想大喊大叫，想把整个阻隔在你我之间的世界撕裂。呼吸急促，面额潮红，手指颤抖，在激烈的想象中把自己感动的快哭了。而事实总是一动不动的坐着，安静的看你远去。你的脸，从开始到现在，我原来从未曾看清楚过。我知道我只能陪你走这一段路。</p><p><br></p>','来源','1,2,3','1') ;
INSERT INTO cms_article_data (id,content,copyfrom,relation,allow_comment) VALUES ('14','<p>&nbsp; &nbsp; &nbsp; &nbsp; 重要的人，不能忘记的人，不想忘记的人！悲伤和爱怜，都一样消失。甚至连自己为什么会哭，我都已经不明了。如沙子作的城堡崩塌一样，感情也轰然不在。沙子崩塌以后，也有唯一不会消失的沙块，那就是寂寞。我了解了，这个瞬间我知道了。之后残存于我心中的，只会有这个感情。像是被人强行塞给的负重，我怀抱着寂寞。――没什么。世界如果是如此残酷的地方的话，我会带着这唯一的寂寞，用全身全灵活给这个世界看。带着这唯一的感情永远的挣扎下去。即使相隔天涯，即使再也见不到面，我会挣扎。永远不可能向这个世界妥协――一时间，我只是强烈的怀抱着想要和神明较劲的想法，连自己忘却了这件事，都马上忘却了。所以我在这样感情的奔流下，最后一次，大声向夜空喊道。你的，名字是？<br></p><p><br></p>','来源','1,2,3','1') ;
INSERT INTO cms_article_data (id,content,copyfrom,relation,allow_comment) VALUES ('15','<p>你，<br>一会看我，<br>一会看云。<br>我觉得，<br>你看我时很远，<br>你看云时很近。<br></p><p><br></p>','来源','1,2,3','1') ;
INSERT INTO cms_article_data (id,content,copyfrom,relation,allow_comment) VALUES ('16','<pre><code>少年听雨歌楼上，  
INSERT INTO cms_article_data (id,content,copyfrom,relation,allow_comment) VALUES ('17','<p>“姑娘，庭前飘雨风逍遥，为何在此掩面而泣？”&nbsp;</p><p>“君不知，故人一去仍未归，我凄苦无依，门前树都已亭亭如盖，让我怎能欢心？”&nbsp;</p><p>“那你为何不抬头看看我？”<br></p><p><br></p><p><img src="/uploads/editor/userid_1/images/2017-09-21/7d417836c5b54cf68283971f24fa6f7e.jpg" alt="57004560_p2" style="max-width:100%;"><br></p><p><br></p>','来源','1,2,3','1') ;
INSERT INTO cms_article_data (id,content,copyfrom,relation,allow_comment) VALUES ('18','<p>因为这个世界上没有什么东西可以比得上孩子暗地里悄悄所怀的爱情！因为这种爱情不抱希望，低声下气，曲意逢迎，热情奔放……</p><p>这和成年人那种欲火炙烈，不知不觉中贪求无厌的爱情完全不同。只有孤独的孩子才能把全部的热情集聚起来。我毫无阅历，毫无准备……</p><p>我一头栽进我的命运，就像跌进一个深渊……</p><p>从那一秒钟起，我的心里就只有一个人——就是你……<br></p><p><br></p>','来源','1,2,3','1') ;
